import React from 'react'
import Input from './Input'
import css from './css/styles.css'

function Table() {

  return(

<div className="center">
<table>
			<thead>
				<tr>
					<th>Name</th>
					<td><input type="text" name="name" id="name" /></td>
				</tr>
			</thead>
			<tbody>
				<tr>
					<th>Latitude</th>
					<td><input type="text" name="lati" id="lati" /></td>
				</tr>
				<tr>
					<th>Longitude</th>
					<td><input type="text" name="longi" id="longi" /></td>
				</tr>
				<tr>
					<th>Address</th>
					<td><input type="text" placeholder='N/A if not using latitude and longitude' name="address" id="address" /></td>
				</tr>
				<tr id="btna">
					<td colspan="2"><input type="button" name="button" id="btn" value="Add" onclick="AddRow()" /></td>
				</tr>
			</tbody>
		</table>

		<table id="show">
			<thead>
				<tr>
					<th>Name</th>
					<th>Latitude</th>
					<th>Longitude</th>
					<th>Address</th>
				</tr>
			</thead>
		</table>

    </div>

  )

var list1 = [];
var list2 = [];
var list3 = [];
var list4 = [];

var n = 1;
var x = 0;

function AddRow(){

    var AddRown = document.getElementById('show');
    var NewRow = AddRown.insertRow(n);

    list1[x] = document.getElementById("name").value;
    list2[x] = document.getElementById("lati").value;
    list3[x] = document.getElementById("longi").value;
    list4[x] = document.getElementById("address").value;

    var cel1 = NewRow.insertCell(0);
    var cel2 = NewRow.insertCell(1);
    var cel3 = NewRow.insertCell(2);
    var cel4 = NewRow.insertCell(3);

    cel1.innerHTML = list1[x];
    cel2.innerHTML = list2[x];
    cel3.innerHTML = list3[x];
    cel4.innerHTML = list4[x];

    n++;
    x++;
}
};



export default Table;
